// static function
uint8_t
SrgbF2C::sRGB(const float f)
//
// direct conversion from 32bit single float to sRGB space 8bit uchar
//
{
    if (f <= 0.0f) return 0;

    //
    // See more detail for SrgbF2CLUT.{h,cc}. You can see main idea of logic
    // itself. See tblGen15bit() functions for more detail.
    // Toshi (Sep/28/2020)
    //
    union Uni {
        float f;
        unsigned u;
    };
    const Uni *uni = reinterpret_cast<const Uni *>(&f);
    return sRGBf2c[(uni->u >> 16) & 0x7fff];
}

